      'displayName':med
    };
  }

  return (retObj);
}

// This function will attempt to determine if a given medication string is really multiple medications.
// If so, it will split the string into its component medications and return them as an array.
// If not, it will return the original medication as an array (with one element).
function processMedName(med) {
  var regimenDelimiters = /[\+,\/\.]/;

  med = med.replace(/\s+\(/, "(");
  med = med.replace(/ /g, "_");
  med = med.replace(/\/100/g, "|100");
  if (med.toLowerCase().search(regimenDelimiters) >= 0) {
    if (med.toLowerCase().search('/r') >= 0) {
      med = med.replace(/\/r/g, "^r");
      med = med.replace(/\/R/g, "^R");
    }

    var retArr = med.split(regimenDelimiters);
    for (var i = 0; i < retArr.length; i++) {
      if (retArr[i] == "" || retArr[i] == null || retArr[i].length < 1) continue;
      retArr[i] = lookupMed(retArr[i].replace(/^[0-9]+-/, '')
                                     .replace(/^.*=/, '')
                                     .replace(/_/g, " ")
                                     .replace(/\|/g, "/")
                                     .replace(/\^r/g, "/r")
                                     .replace(/\^R/g, "/R")
                                     .replace(/^\s\s*/, '')
                                     .replace(/\s\s*$/, ''));
    }
    return (retArr);
  } else {
    var retArr = [lookupMed(med)];
    return (retArr);
  }
}

