  // <effectiveTime value=""/> => <effectiveTime nullFlavor="UNK"/>
  if (tmpEntry['encounter']['effectiveTime']['@value'] == "") {
    delete tmpEntry['encounter']['effectiveTime']['@value'];
    tmpEntry['encounter']['effectiveTime']['@nullFlavor'] = "UNK";
