entry.string:
var maxEnc = 12;
var idxEncBases = {
  'eid':257, 'date':258, 'type':259, 'clinInit':353
};
var idxEncOffset = 97;

var textTmpl = tmp['component']['structuredBody']['component'][0]['section']['text']['table']['tbody']['tr'].copy();
var entryTmpl = tmp['component']['structuredBody']['component'][0]['section']['entry'].copy();
delete tmp['component']['structuredBody']['component'][0]['section']['text']['table']['tbody']['tr'];
delete tmp['component']['structuredBody']['component'][0]['section']['entry'];
for (var i = 0; i < maxEnc; i++) {
  // if no id, we're done processing encounters, so break
  if (msgRead(idxEncBases['eid'] + (i * idxEncOffset)) == null ||
      msgRead(idxEncBases['eid'] + (i * idxEncOffset)) == "") {
    break;
  }

  var tmpText = textTmpl.copy();
  var tmpEntry = entryTmpl.copy();

  // save encounter id to use as reference in other body sections//  channelMap.put('enc' + i + 'Id', msgRead(idxEncBases['eid'] + (i * idxEncOffset)));

  // Populate text elements
  var encId = 'EncType' + i;
  var encType = msgRead(idxEncBases['type'] + (i * idxEncOffset));
  var encContent = <content ID={encId}>{encType}</content>;
  tmpText['td'][0].appendChild(encContent);
  tmpText['td'][1] =
    msgRead(idxEncBases['clinInit'] + (i * idxEncOffset));
  tmpText['td'][2] =
    channelMap.get('facName');
  tmpText['td'][3] =
    msgRead(idxEncBases['date'] + (i * idxEncOffset)).substring(4, 6) +
    "/" + msgRead(idxEncBases['date'] + (i * idxEncOffset)).substring(6, 8) +
    "/" + msgRead(idxEncBases['date'] + (i * idxEncOffset)).substring(0, 4);
  // Done populating encounter text elements

  // Append populated encounter text node
  tmp['component']['structuredBody']['component'][0]['section']['text']['table']['tbody'].appendChild(tmpText);

  // Populate entry elements
  tmpEntry['encounter']['id']['@root'] = idRootOid;
  tmpEntry['encounter']['id']['@extension'] =
    msgRead(idxEncBases['eid'] + (i * idxEncOffset));
  tmpEntry['encounter']['code']['@code'] = encType;
  tmpEntry['encounter']['code']['@displayName'] = encType;
  tmpEntry['encounter']['code']['originalText']['reference']['@value'] = '#' + encId;
  tmpEntry['encounter']['text']['reference']['@value'] = '#' + encId;
  tmpEntry['encounter']['effectiveTime']['@value'] =
    msgRead(idxEncBases['date'] + (i * idxEncOffset));
  tmpEntry['encounter']['performer']['assignedEntity']['id']['@root'] = idRootOid;
  tmpEntry['encounter']['performer']['assignedEntity']['id']['@extension'] =
    msgRead(idxEncBases['clinInit'] + (i * idxEncOffset));
  tmpEntry['encounter']['performer']['assignedEntity']['assignedPerson']['name'] =
    msgRead(idxEncBases['clinInit'] + (i * idxEncOffset));
  tmpEntry['encounter']['participant']['participantRole']['id']['@root'] = idRootOid;
  tmpEntry['encounter']['participant']['participantRole']['id']['@extension'] =
    channelMap.get('facName');
  tmpEntry['encounter']['participant']['participantRole']['playingEntity']['name'] =
    channelMap.get('facName');

  // Dispose of any unpopulated nodes
  if (msgRead(idxEncBases['clinInit'] + (i * idxEncOffset)) == "" ||
      msgRead(idxEncBases['clinInit'] + (i * idxEncOffset)) == null) {
    delete tmpEntry['encounter']['performer'];
  }

  if (channelMap.get('facName') == "" ||
      channelMap.get('facName') == null) {
    delete tmpEntry['encounter']['participant'];
  }

  // If there are any remaining required values that are empty, replace with nullFlavor="UNK":

  // <code code="" .../> => <code nullFlavor="UNK"/>
  if (tmpEntry['encounter']['code']['@code'] == "") {
    delete tmpEntry['encounter']['code']['@code'];
    delete tmpEntry['encounter']['code']['@displayName'];
    delete tmpEntry['encounter']['code']['@codeSystem'];
    delete tmpEntry['encounter']['code']['@codeSystemName'];
    tmpEntry['encounter']['code']['@nullFlavor'] = "UNK";
  }

  // <effectiveTime value=""/> => <effectiveTime nullFlavor="UNK"/>
  if (tmpEntry['encounter']['effectiveTime']['@value'] == "") {
    delete tmpEntry['encounter']['effectiveTime']['@value'];
    tmpEntry['encounter']['effectiveTime']['@nullFlavor'] = "UNK";
  }

  // Append populated encounter entry node
  tmp['component']['structuredBody']['component'][0]['section'].appendChild(tmpEntry);
}

