var maxPoorAdh = 5;
var idxPoorAdhBases = {
  'priorMed':321, 'priorAdh':323
};

var textTmpl = tmp['component']['structuredBody']['component'][1]['section']['text']['table']['tbody']['tr'].copy();
var entryTmpl = tmp['component']['structuredBody']['component'][1]['section']['entry'].copy();
