for (var i = 0; i < maxEnc; i++) {
  for (var j = idxPoorAdhBases['priorAdh'] + (i * idxEncOffset);
           j < idxPoorAdhBases['priorAdh'] + (i * idxEncOffset) + maxPoorAdh;
           j++) {
    // if the reason for poor adherence is not 'Toxicity/side effects' or the medication name is empty,
    // then skip it (doesn't belong in this section)
    if (msgRead(j) != "1-Toxicity/side effects" ||
        msgRead(idxPoorAdhBases['priorMed'] + (i * idxEncOffset)).replace(/^\s\s*/, '')
                                                                 .replace(/\s\s*$/, '') == "" ||
        msgRead(idxPoorAdhBases['priorMed'] + (i * idxEncOffset)) == null) {
      continue;
    } else {
      // found med(s) to be added to this section, break loop when done (only need to add once per encounter)

      // Process the medication (or multiple medications if it's a regimen)
